import React from 'react'
import Feed from './Feed'
import PanelLeft from './PanelLeft'
class Home extends React.Component{
    render(){
        const style={
            display: 'grid',
            gridTemplateColumns: '25% 50% 25%',
            gridGap: '10px',
            marginLeft: '20px',
            marginRight: '20px'
        }
        return(
            <div style={style}>
                <PanelLeft />
                <Feed />
                <p>2</p>
            </div>
        )
    }
}

export default Home
